contracts/BlizzardOracleRouter.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Burnable.sol";
import "@openzeppelin/contracts/utils/cryptography/draft-EIP712.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/draft-ERC721Votes.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

contract BlizzardOracleRouter is
    ERC721,
    ERC721Enumerable,
    ERC721URIStorage,
    Pausable,
    AccessControl,
    ERC721Burnable,
    EIP712,
    ERC721Votes
{
    using Counters for Counters.Counter;

    bytes32 public constant PAUSER_ROLE = keccak256("PAUSER_ROLE");
    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");
    Counters.Counter private _tokenIdCounter;

    enum Currency {
        Ru,
        Usd,
        Euro,
        Yien
    }

    event PriceRequest(address from, Currency base, Currency quote);

    constructor()
        ERC721("BlockchainOracleToken", "BOT")
        EIP712("BlockchainOracleToken", "1")
    {
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(PAUSER_ROLE, msg.sender);
        _grantRole(MINTER_ROLE, msg.sender);
    }

    function pause() public onlyRole(PAUSER_ROLE) {
        _pause();
    }

    function unpause() public onlyRole(PAUSER_ROLE) {
        _unpause();
    }

    function safeMint(
        address to,
        string memory uri
    ) public onlyRole(MINTER_ROLE) {
        uint256 tokenId = _tokenIdCounter.current();
        _tokenIdCounter.increment();
        _safeMint(to, tokenId);
        _setTokenURI(tokenId, uri);
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId,
        uint256 batchSize
    ) internal override(ERC721, ERC721Enumerable) whenNotPaused {
        super._beforeTokenTransfer(from, to, tokenId, batchSize);
    }

    // The following functions are overrides required by Solidity.

    function _afterTokenTransfer(
        address from,
        address to,
        uint256 tokenId,
        uint256 batchSize
    ) internal override(ERC721, ERC721Votes) {
        super._afterTokenTransfer(from, to, tokenId, batchSize);
    }

    function _burn(
        uint256 tokenId
    ) internal override(ERC721, ERC721URIStorage) {
        super._burn(tokenId);
    }

    function tokenURI(
        uint256 tokenId
    ) public view override(ERC721, ERC721URIStorage) returns (string memory) {
        return super.tokenURI(tokenId);
    }

    function supportsInterface(
        bytes4 interfaceId
    )
        public
        view
        override(ERC721, ERC721Enumerable, AccessControl)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }

    function getPriceSimple(uint8 base, uint8 quote) external returns (bool) {
        emit PriceRequest(msg.sender, Currency(base), Currency(quote));
        return true;
    }

    //  {url_base}, {path}, {query}, {headers}
    function getPriceFull(
        bytes32 url_base,
        bytes32 path,
        bytes32 query,
        bytes32 headers
    ) external returns (bool) {
        return true;
    }
}

contracts/CustomerContract.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "./BlizzardOracleRouter.sol";

contract CustomerContract is BlizzardOracleRouter {
    event PriceInfo(bytes32 base, bytes32 quote);
    address oracle;

    constructor() BlizzardOracleRouter() {}

    function responseHandler(bytes32 base, bytes32 quote) external {
        emit PriceInfo(base, quote);
    }

    function priceRequest(bytes32 url_base, bytes32 path, bytes32 query, bytes32 headers) external returns (bool) {
       bool result = BlizzardOracleRouter(oracle).getPriceFull(url_base, path, query, headers);

       return result;
    }
}

